): Total length 1.00. Habitus as in figure 112A. CEPHALOTHORAX: Carapace as in figure 112C. Clypeus as in figure 112B. Sternum as long as wide. Anterior face of chelicerae with conical projections near promargin (fig. 112C). Labium rectangular. LEGS: Yel- low. GENITALIA: Cymbium yellow; bulb stout, tapering apically, with two strong, dark apophysis; embolus short; sperm duct coiled, with many loops (figs. 131A–C, 140E–G).

FEMALE (PBI_ 
OON 10936
): Total length 1.00. Habitus as in figure 112D. CEPHALOTHORAX: Carapace with texture “fingerprint” (fig. 113F). Chelicerae anterior face unmodified (figs. 113B, 114C, F). Endites, sternum as in figure 114D, E, G. ABDOMEN: Epigastric region weakly sclerotized, slightly protruding. Palp tibia with three trichobothria (fig. 114A, B). Spinnerets (fig. 116A–D): ALS with one MAP and three PI spigots (fig. 116B); PMS with two spigots of similar size, presumably from aciniform glands (fig. 116D); PLS with three AC spigots (fig. 116C), colulus with two setae (fig. 116E). LEGS: Claws and tarsal organs as described for genus (fig. 115). GENITALIA: External, internal pockets absent (figs. 117, 134A, B); with lateral plates converging at median field (figs. 117, 134A, B, 137A, B, 144C), anterior receptaculum thin, wide at tip, with well-developed anterior apodemes (fig. 117A–C); posterior receptaculum present (fig. 117A, D, collapsed), posterior apodeme formed by entire plate.
